import { Component } from "react";

class Home extends Component {
   render() {
        return (
            <span>
                <h1 className="text-center">{this.props.name}'s homepage<button className="btn btn-secondary">Logout</button></h1>
                
            </span>
        )
   }
}

export default Home;
